\r\nU kunt het aantal openstaande facturen en de gemiddelde betalingstermijn van uw openstaande facturen flink terugdringen. \r\n \r\nWij, van Money Management, zijn credit management specialisten met een hart voor incasso. Wij halen graag binnen waar u recht op heeft en doen dit op basis van No cure, No pay + Cure = Bonus. \r\nDit is een uniek concept ontwikkeld door ons en houdt in dat jullie als klant een deel van onze inkomsten ontvangen. Dit zorgt niet alleen voor meer omzet aan uw kant, maar legt de druk op presteren neer bij ons. \r\n \r\nZie https://www.mmincasso.nl/minnelijke-incasso/ voor meer informatie. \r\n \r\n \r\nEn van onze specialiteiten is incasseren met klantbehoud. Incasseren kunnen wij geheel zelfstandig, maar ook in samenspraak. Ons doel is om een partnerschap in plaats van alleen een klantrelatie aan te gaan. \r\nOntwikkelingen in de voortgang van uw dossiers kunt u 24/7 inzien via ons online portaal. \r\n \r\nWij zouden onze werkwijze graag willen toelichten. Dit kan face to face of u kunt ons bereiken via onderstaand e-mailadres. Meer contact mogelijkheden zijn te vinden op onze website. \r\nUiteraard kunt u ook direct uw dossiers aanleveren bij ons, wij nemen contact met u op omtrent de afwikkeling. Dit kost u dus verder niets, wij voeren geen verborgen kosten. \r\n \r\nLaat het ons a.u.b. weten indien u vragen heeft over onze dienstverlening. \r\n \r\nWij wensen u een fijne dag toe. \r\n \r\n \r\nMet vriendelijke groet, \r\n \r\nI. van der Werf \r\n \r\nMoney Management \r\nhttps://www.mmincasso.nl \r\nE: info@mmincasso.nl'),(2274,567,'_field_submit','Verzenden'),(2275,567,'_fields','a:7:{s:10:\"first-name\";N;s:9:\"last-name\";N;s:10:\"your-email\";N;s:12:\"your-company\";N;s:12:\"your-subject\";N;s:12:\"your-message\";N;s:6:\"submit\";N;}'),(2276,567,'_meta','a:19:{s:13:\"serial_number\";i:3;s:9:\"remote_ip\";s:14:\"139.28.217.222\";s:10:\"user_agent\";s:129:\"Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gec