\r\nPilar Castillo \r\nAnwaeltin.'),(2454,579,'_field_submit','Verzenden'),(2455,579,'_fields','a:7:{s:10:\"first-name\";N;s:9:\"last-name\";N;s:10:\"your-email\";N;s:12:\"your-company\";N;s:12:\"your-subject\";N;s:12:\"your-message\";N;s:6:\"submit\";N;}'),(2456,579,'_meta','a:19:{s:13:\"serial_number\";i:3;s:9:\"remote_ip\";s:14:\"178.162.203.70\";s:10:\"user_agent\";s:102:\"Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/49.0.2623.112 Safari/537.36\";s:3:\"url\";s:36:\"http://update.dev-atvise.nl/contact/\";s:4:\"date\";s:12:\"20 juni 2019\";s:4:\"time\";s:5:\"23:26\";s:7:\"post_id\";s:1:\"9\";s:9:\"post_name\";s:7:\"contact\";s:10:\"post_title\";s:16:\"Contactformulier\";s:8:\"post_url\";s:36:\"http://update.dev-atvise.nl/contact/\";s:11:\"post_author\";s:6:\"Atvise\";s:17:\"post_author_email\";s:15:\"tjerk@atvise.nl\";s:10:\"site_title\";s:15:\"Blog About Life\";s:16:\"site_description\";s:0:\"\";s:8:\"site_url\";s:27:\"http://update.dev-atvise.nl\";s:16:\"site_admin_email\";s:15:\"tjerk@atvise.nl\";s:10:\"user_login\";s:0:\"\";s:10:\"user_email\";s:0:\"\";s:17:\"user_display_name\";s:0:\"\";}'),(2457,579,'_akismet',NULL),(2458,579,'_consent','a:0:{}'),(2459,580,'_subject','Fintech turnkey solutions'),(2460,580,'_from','[your-name] <kelly.cruz@evrosis.com>'),(2461,580,'_from_name','[your-name]'),(2462,580,'_from_email','kelly.cruz@evrosis.com'),(2463,580,'_field_first-name','AllenSoump'),(2464,580,'_field_last-name','AllenSoump'),(2465,580,'_field_your-email','kelly.cruz@evrosis.com'),(2466,580,'_field_your-company','google'),(2467,580,'_field_your-subject','Fintech turnkey solutions'),(2468,580,'_field_your-message','EVROSIS Technologiess turnkey solutions: we customize our products and services to meet the exact requirements of our clients. At EVROSIS TECHNOLOGIES, our developers, engineers, and data scientists are experts in Financial Engineering, High Frequency Trading, Trading Platform & financial markets. \r\n \r\nOur competitiv